import React from "react";


const SlotM = (props) => {
    let x = props.x;
    let y = props.y;
    let z = props.z;
    
    if ((x === y) && (y === z)) {
        return (
            <>
                <div className='slot_inner'>
                    <h1>
                        {x}{y}{z}
                    </h1>
                    
                    <h1>This is matching</h1>
                    <hr />

                </div>



            </>
        );
    }
    else {
        return (
            <>
                <div className='slot_inner'>
                    <h1>
                        {x}{y}{z}
                    </h1>

                    <h1>This is not  matching</h1>
                    <hr />

                </div>



            </>
        );
    }
}




const Game = () => {
    return (
        <>
            <h1 className="heading_style">
               🎰 Welcome to <span style = {{fontWeight : 800}}>Slot Machine Game</span> 🎰
            </h1>
          <div className="slotMachine"> 
                <SlotM x='😄' y='😄' z='😄' />
                <SlotM x='🐍' y='🐍' z='🐍' />
                <SlotM x='❤️' y=' ❤️' z='❤️' />
            
        </div>

        </>  
    );   
        
}   


export default Game;
